import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const DifferentSection = () => {
  return (
    <section className="d-flex justify-content-center align-items-center min-vh-100 bg-light">
      <Container className="text-center">
        <Row className="justify-content-center align-items-center">
          <Col md={6}>
            <h1 className="fw-bold">Welcome to Our Community</h1>
            <p className="text-muted">Sign up to join our amazing platform</p>
            <Button as={Link} to="/register" variant="primary" className="px-5">
              Register Now
            </Button>
          </Col>
          <Col md={6}>
            <img
              src="path/to/your/image.jpg"
              alt="Welcome"
              className="img-fluid"
            />
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default DifferentSection;
